import React from 'react'


const ImgTest = ({el}) => {
    return (
       <>
            <div className="col col-sm-6">
                <div className="textCard ">
                    <div>
                         <h3>{el.title}</h3>
                <p>{el.par}</p>
                    </div>

                     <img width="100%"
                    src={el.img}
                    alt={el.title}
                  /> 
                </div>




        </div>
      </>
    )
}

export default ImgTest
